import "./LeftPane.css";

const Leftpane = ({navigationListItems}) => {
    let toBeRenderedNavigationListItems = navigationListItems.map(item => {
        console.log(item);
        return(
        <li keyclassName="dashboard__li">
        <a href="" className="dashboard__link">{item}</a>
               </li>
        );
    });

    return (
        <section class="dashboard__wrapper">
        <nav className="dashboard__nav">
            <ul className="dashboard__ul">
              {toBeRenderedNavigationListItems}
            </ul>
        </nav>
        <button className="dashboard__button">Button!!</button>
        </section>
    );
}

export default Leftpane;
